 3. Güteraufzug: ein Aufzug im Sinn des § 2 Z 1 lit. d des Oö. Aufzugsgesetzes 1998; 
 4. Kleingüteraufzug:  ein  Güteraufzug  (Z.  3)  mit  einer  Nennlast  von  nicht  mehr  als  300  kg,  dessen 
Lastträger wegen seiner Maße und Ausführung für Personen nicht betretbar ist;

Ausfertigung anzuschließen: 
 1. eine technische Beschreibung samt Anlagenzeichnung; 
 2. Unterlagen   über   die   statische   Bemessung   und   die   Ausführung   hinsichtlich   Brandschutz, 
Schallschutz, Energieeffizienz, Barrierefreiheit sowie die Lage des Aufzugs im Gebäude; 
 3. gegebenenfalls die Entscheidung gemäß § 6a Aufzüge-Sicherheitsverordnung 2015; 
 4. ein Gutachten einer Aufzugsprüferin oder eines Aufzugsprüfers gemäß § 4. 
